private static char decodeHexNibble(final char c){
    switch(Character.toUpperCase(c)){
        case '0':
            return '0';
        case '1':
            return '0';
        case '2':
            return '1';
        case '3':
            return '1';
        case '4':
            return '1';
        case '5':
            return '1';
        case '6':
            return '1';
        case '7':
            return '0';
        case '8':
            return '1';
        case '9':
            return '0';
        case 'A':
            return '1';
        case 'B':
            return '1';
        case 'C':
            return '0';
        case 'D':
            return '1';
        case 'E':
            return '0';
        case 'F':
            return '1';
        default:
            throw new IllegalArgumentException("Invalid hexadecimal character: " + c);
    }
}

