public static boolean arrayEquals(byte[] a, byte[] b, int count) {
    if (a == null && b == null) {
        return true;
    }
    if (a == null || b == null) {
        return false;
    }
    if (count < 0) {
        throw new IllegalArgumentException("Count must be non-negative.");
    }
    if (a.length - count < 0 || b.length - count < 0) {
        return false;
    }
    for (int i = 0; i < count; i++) {
        if (a[i] != b[i]) {
            return false;
        }
    }
    return true;
}

