private void pop(final String descriptor){
  //get the last character of the descriptor
  final char type = descriptor.charAt(descriptor.length()-1);
  switch(type){
    case 'Z':
      m_popZ();
      break;
    case 'C':
      m_popC();
      break;
    case 'D':
      m_popD();
      break;
    case 'F':
      m_popF();
      break;
    case 'I':
      m_popI();
      break;
    case 'J':
      m_popJ();
      break;
    case 'B':
      m_popB();
      break;
    case 'S':
      m_popS();
      break;
    case 'L':
      m_popL();
      break;
  }
}

