method:
private int parseEndOfLine(String headerPart, int end) {
    for (int i = end; i > 0; i--) {
        if (headerPart.charAt(i) == '\n' && headerPart.charAt(i - 1) == '\r') {
            return i - 1;
        }
    }
    return -1; // Return -1 if no CRLF is found
}

