public static int countOccurrencesOf(String str,String sub){
    String tempStr = str;
    tempStr=tempStr.toLowerCase();
    str=str.toLowerCase();
    sub=sub.toLowerCase();
    int totalCount = 0;
    while(tempStr.indexOf(sub) > 0){
        totalCount++;
        tempStr = tempStr.substring(tempStr.indexOf(sub)+1,tempStr.length());
    }
    return totalCount;
}

