public static String trimTrailingWhitespace(String str) {
    if (str == null || str.isEmpty()) {
        return str;
    }

    int lastIndex = str.length() - 1;
    while (lastIndex >= 0 && Character.isWhitespace(str.charAt(lastIndex))) {
        lastIndex--;
    }

    return str.substring(0, lastIndex + 1);
}

